import React from "react";
import data from "./data";

const List = () => {
    return(
        <div>
            <h2>List Component</h2>
            <ul>
                {data.map( (e) => {
                    return (
                        <li>{e.id}{e.name}</li>
                    )
                })}
            </ul>
        </div>
    )
}

export default List
